import styled from "styled-components";
import {Icon} from "../../icon/Icon";

type ElipsWrapperSkillType = {
    top: string
    left:string
    right:string
    bottom: string
    iconId: string
}


export const ElipsWrapperSkill = styled.div<ElipsWrapperSkillType>`
  position: absolute;
  height: 6rem;
  width: 6rem;
  margin: 1em auto;
  background-color: linear-gradient(#414141 0%, #2D2D2D 100%);
  background-image: url(${props => Icon({iconId: 'main_html'})});
  border-radius: 50%;
  z-index: 1;
  
  top: ${props => props.top};
  left: ${props => props.left};
  right: ${props => props.right};
  bottom: ${props => props.bottom};
 
  
  :before {
    content: "";
    height: 41px;
    width: 47px;
    display: inline-block;
    vertical-align: middle;
    padding-top: 100%;
    background-image: url(${props => Icon({iconId: 'main_html'})});
    background-size: contain;
    background-repeat: no-repeat;
    z-index: -1;
  }
`
